package Array;

public class Array1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		String[] std = new String[10];
		std[0] = "Sneha";
		std[1] = "Itishree";
		std[2] = "Aniket";
		std[3] = "Pratik";
		std[4] = "Puja";
		std[5] = "Bilwa";
		std[6] = "Prachi";
		std[7] = "Dhara";
		std[8] = "Nitu";
		std[9] = "Anand";

		System.out.println(std.length);

		for (int i = 0; i < std.length; i++) {
			System.out.println(std[i]);
		}

	}

}
